import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import RobotsCard from "./RobotsCard";
import {robots} from '../robots';
import {Searchbar} from './Searchbar';





const RobotsList = ({robots}) => {
	const shuffle = robots.map((user,i )=> {
  	return <RobotsCard key={i} id={robots[i].id} name={robots[i].name} email={robots[i].email}/>

  	})
  return (
    <div className="tc">
    <Searchbar >
                <div className='dv'>
                  <div className='Sc'>

                        <input  className="inpt" type="search" placeholder="Search..." />
                        <span  className="search_icon"><i className="fas fa-search"></i></span>

                  </div>
               </div>
              </Searchbar> 
    	{shuffle}
    </div>
  )
}

export default RobotsList;
